    <SvgUri
      width="200"
      height="200"
      svgXmlData={`<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="24" height="24">
                                <path fill="#000" d="M0 0h24v24H0z" />
